// src/components/Navbar.tsx

import React, { useState } from 'react';
import { Link } from 'react-router-dom'
import './navbar.css';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="logo">My Portfolio</div>
      <div className='nav-items'>
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Projects</a>
        <a href="#">Contact</a>
      </div>
    </nav>
  );
};

export default Navbar;
